import React from 'react';
import { Approval } from 'components';
import { withKnobs, boolean, text, object } from '@storybook/addon-knobs';

export default {
  title: 'Approval',
  component: Approval,
  decorators: [withKnobs],
};

const users = [
  { id: 1, fullName: 'Andre Agassi' },
  { id: 2, fullName: 'Pete Sampras' },
  { id: 3, fullName: 'Alex Moreno' },
  { id: 4, fullName: 'Roger Federer' },
  { id: 5, fullName: 'Jane Doe' },
];
export const Default = () => {
  const label = 'User';
  const defaultValue = {
    fullName: 'Joe Smith',
  };
  const user = object(label, defaultValue);
  return (
    <Approval
      title={text('Title', 'Approved')}
      userKey={text('UserKey', 'mockUserKey')}
      user={user}
      approvedDate={text('Approved Date', '2021-01-14')}
      approvedDateKey={text('Approved Date Key', 'Date key 123')}
      isApproved={boolean('Is Approved', false)}
      isApprovedKey={text('Is Approved Key', 'Approved Key 123')}
      users={users}
      onChange={() => alert('Changed !')}
      disabled={boolean('Disbaled', false)}
      disableApproval={boolean('Disable Approval', false)}
    />
  );
};
